import React from "react";
import { NavLink, useRouteMatch } from "react-router-dom";
import home from "../assets/home.png";
import money from "../assets/money.png";
import createorder from "../assets/create-order.png";
import user from "../assets/user.png"
import { CreateNewOrder } from "./CreateNewOrder";

export default function Footer(){
  let { url } = useRouteMatch();
  return (
    <div
      className="align-items-center d-flex justify-content-evenly togo-button"
      style={{height: "100px"}}
    >
      <NavLink to={`${url}/`} className={"text-center"}>
        <img src={home} className="m-auto" />
        Home
      </NavLink>
      <NavLink to={`${url}/wallet`} className={"text-center"}>
        <img src={money} className="m-auto" />
        Wallet
      </NavLink>
      <CreateNewOrder>
        <div className={"text-center text-white"}>
          <img src={createorder} className="m-auto" />
          Create New Order
        </div>
      </CreateNewOrder>
      <NavLink to={`${url}/settings`} className={"text-center"}>
        <img src={user} className="m-auto" />
        Settings
      </NavLink>
    </div>
  )
}
